// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awColorPickerRenderFunction } from 'js/AwColorPickerService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwColorPickerService', () => import('js/AwColorPickerService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "lifecycleHooks": {
        "render": "render"
    },
    "actions": {
        "render": {
            "method": "awColorPickerRenderFunction",
            "deps": "js/AwColorPickerService"
        }
    },
    "props": {
        "selected-color": {
            "type": "object"
        }
    },
    "_viewModelId": "AwColorPicker",
    "_uniqueViewModelId": "AwColorPicker",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awColorPickerRenderFunction, undefined, ctxImportObj );

export default Component;
